  for(var t=0;t<6;t++)
  {
   for(var d1=0;d1<6;d1++)
   {
    tables[l][t][d1]=[];
   }
  }
 }
 for(var l=0;l<2;l++)
 {
  for(var t=0;t<6;t++)
  {
   for(var d1=0;d1<6;d1++)
   {
    for(var d2=0;d2<6;d2++)
    {
     tables[l][t][d1][d2]=''+l+t+d1+d2;
    }
   }
  }
 }

 minRun=0;
 while(minRun<runToSucceed)
 {
  //console.log('-------------------- NEW TABLES! --------------------');
  for(var l=0;l<2;l++)
  {
   for(var t=0;t<6;t++)
   {
    for(var d1=0;d1<6;d1++)
    {
     for(var d2=0;d2<6;d2++)
     {
      tables[l][t][d1][d2]=''+l+t+d1+d2;
     }
    }
   }
  }

  for(var l=0;l<2;l++)
  {
   for(var t=0;t<6;t++)
   {
    for(var d1=0;d1<6;d1++)
    {
     for(var d2=0;d2<6;d2++)
     {
      values.push([l,t,d1,d2]);
     }
    }
   }
  }
  let tl=rnd(1);
  let tt=rnd(5);
  let td1=rnd(5);
  let td2=rnd(5);
  let tries=0;
  while(values.length>0)
  {
   let fIndex=rnd(values.length-1);
   let f=values[fIndex];
   let fString=''+f[0]+f[1]+f[2]+f[3];
   values.splice(fIndex,1);
   tries++;
   if(fString!=tables[tl][tt][td1][td2] &&
     fString!=''+tl+tt+td1+td2)
   {
    tables[tl][tt][td1][td2]=fString;
    tl=f[0];
    tt=f[1];
    td1=f[2];
    td2=f[3];
   }
   else
   {
    values.push(f);
   }
   if(tries>1000)
   {
    break;
   }
  }
  if(tries>1000)
  {
   minRun=0;
   continue;
  }

  //console.log('-------------------- TESTING RUNS --------------------');
  for(var l=0;l<2;l++)
  {
   for(var t=0;t<6;t++)
   {
    for(var d1=0;d1<6;d1++)
    {
     for(var d2=0;d2<6;d2++)
     {
      values.push([l,t,d1,d2]);
     }
    }
   }
  }
  minRun=6*6*6*2;
  while(values.length>0)
  {
   let run=0;
   let startIndex=rnd(values.length-1);
   let start=values[startIndex];
   values.splice(startIndex,1);
   let lrun=start[0];
   let trun=start[1];
   let d1run=start[2];
   let d2run=start[3];
   let rolls=[];
   while(!rolls.includes(''+lrun+trun+d1run+d2run))
   {
    rolls.push(''+lrun+trun+d1run+d2run);
    let next=tables[lrun][trun][d1run][d2run];
    lrun=next[0];
    trun=next[1];
    d1run=next[2];
    d2run=next[3];
    run++;
   }
   if(run<minRun)
   {
    minRun=run;
    shortestRun=rolls;
    if(run<runToSucceed)
    {
     break;
    }
   }
  }
 }

 //console.log('shortest run: '+minRun);
 //console.log(shortestRun);
 for(var l=0;l<2;l++)
 {
  for(var t=0;t<6;t++)
  {
   for(var d1=0;d1<6;d1++)
   {
    for(var d2=0;d2<6;d2++)
    {
     let char=l==0?'A':'B';
     let rt=t+2;
     let rd1=d1+1;
     let rd2=d2+1;
     let value=tables[l][t][d1][d2];
     value=(parseInt(value[1])+2)+
      (value[0]==0?'A':'B')+
      (parseInt(value[2])+1)+
      (parseInt(value[3])+1);
     tables[l][t][d1][d2]=value;
     original=original.replace(''+char+rt+rd1+rd2,value);
    }
   }
  }
 }

 let div=document.getElementById('result');
 div.innerHTML=original;
}

setTimeout(createTables,1000);
